import { User_Submit } from "./Type";
import { User_Delete } from "./Type";

const initialstate = {
    data:[]
}

const reducer = (state = initialstate, action) => {
    console.log("reducerstate", state)
    console.log("reduceraction", action)
    switch (action.type) {
        case User_Submit:
            return {
               ...state,
                data: action.payload
            }
        case User_Delete:
            return {
               ...state,
                data: action.payload
            }
            default: 
                return initialstate
        }
}

export default reducer;
